import React, { useEffect, useState } from 'react'

const Home = () => {
  const [stachList, setStachList] = useState([])
  useEffect(() => {
    fetch('http://localhost:3000/api/stashpoints')
      .then((response) => {
        console.log(response.json())
        let data: any = response.json()
        setStachList([...data])
      })
      .catch((err) => console.log(err))
  }, [])

  return (
    <div>
      <h1>Home</h1>
    </div>
  )
}

export default Home
